import React from 'react';
import { Link } from 'react-router-dom';

const Registro = () => {
  return <div className="col align-self-center">
    <h1> Crea tu cuenta </h1>

      <input type="text" id="createName" placeholder="Nombre de usuario"/>
      <input type="email" id="mailRegister"  placeholder="correo@ejemplo.com" pattern="^\\S+@\\S+\\.\\S+$" required/>
      <input type="password" id="passwordRegister"  placeholder="contraseña" />

      <button id = "btnRegister" type="button" className="btn btn-outline-success"> Registrar </button>

     <p className= "info"> ¿Ya tienes una cuenta? <Link to = {`/login`}> Inicia sesión </Link> </p>
     </div>
};

export default Registro;
